import React from 'react';
const Image = () => {
    return (
        <svg
            width={500}
            height={500}

        >
            <circle
                cx={167}
                cy={171}
                r={85}
                style={{
                    fill: '#fff',
                    stroke: '#000',
                    strokeMiterlimit: 10,
                }}
            />
            <ellipse
                cx={267}
                cy={217}
                rx={92}
                ry={61}
                style={{
                    fill: '#ed2024',
                    stroke: '#000',
                    strokeMiterlimit: 10,
                }}
            />
        </svg>
    );
};

export default Image;
